text:
 @renanalexandre9594  A arbitragem não melhora porque não há interesse nisso nem existe punição. 
Para eles está ótimo asim; ganham para fazer o que quererem e não são responsabilizados por nada.
A CBF comanda a bagunça mas os clubes são cúmplices, porque se organizar só ganha quem trabalha bem.
